/**
 *  StarDsTheme.Inverse
 */
@Composable
public fun StarDsTheme.Inverse(
    isDark: Boolean = isSystemInDarkTheme(),
    content: @Composable
    () -> Unit,
) {
    val colors = if (isDark) {
        darkInverseColors
    } else {
        lightInverseColors
    }
    val gradients = if (isDark) {
        darkInverseGradients
    } else {
        lightInverseGradients
    }
    StarDsTheme(
        colors = colors,
        gradients = gradients,
        content = content,
    )
}
